import React from "react";
import Navbar from "../Navbar/Navbar";
import HeroSection from "../HeroSection/HeroSection";
import ExploreSection from "../ExploreSection/ExploreSection";
import Group from "../Group/Group";
import SellBetter from "../SellBetter/SellBetter";
import HouseOfModels from "../HouseOfModels/HouseOfModels";
import VideoContainer from "../VideoContainer/VideoContainer";
import HowItWorks from "../HowItWorks/HowItWorks";

import IntegrationSection from "../IntegrationSection/IntegrationSection";
import MediaMagicalSection from "../MediaMagicalSection/MediaMagicalSection";
import StoreDataModel from "../StoreDataModel/StoreDataModel";
import SuperchargedSection from "../SuperchargedSection/SuperchargedSection";
import Library from "../Library/Library";
import HeroText from "../HeroText/HeroText";

import Footer from "../Footer/Footer";
import VideoPage from "../VideoPage/VideoPage";

const Homepages = () => {
  return (
    <>
      <div className="min-h-screen bg-black text-white flex flex-col items-center justify-center px-6">
        <Navbar />
        <HeroSection />
      </div>
      {/* Header Section */}
      <nav className="flex items-center justify-between px-4 py-3">
        <div className="w-10 h-10 absolute top-7 left-6">
          <img className="text-white font-bold" src={logo} alt="logo" />
        </div>
        {/* Join Waitlist Button */}

        <div class="absolute top-7 right-6 bg-white text-black [font:sans-serif] font-semibold py-2 px-9 rounded-full shadow-md hover:bg-gray-200 transition">
          <button className="font-bold text-[15px]">Join Waitlist</button>
        </div>
      </nav>
      <header className="text-center">
        <h1 className="md:text-4xl font-sans font-bold">Your Store </h1>
        <h1 className="text- md:text-4xl font-bold bg-clip-text bg-gradient-to-r from-pink-500 to-blue-500">
          AI Ready
        </h1>
        <p className="text-lg md:text-xl text-gray-300">
          An OS that makes your brand generate, personalize and sell better to
          your customers.
        </p>
      </header>

      {/* Upload Section */}
      <div className="mt-8 w-full max-w-md">
        <div className="bg-gray-800 rounded-lg p-4">
          <form className="font-sans font-medium rounded-lg p-2 w-full box-border">
            <input type="hidden" />
            <input
              type="text"
              id="moviename"
              name="moviename"
              placeholder="Generate a photorealistic image male model"
              required
              autoComplete="off"
              className="w-full text-base font-sans mb-2 border-none bg-transparent rounded-md box-border outline-none text-white"
            />
          </form>
          <label
            htmlFor="upload-image"
            className="text-gray-400 cursor-pointer flex-1"
          >
            Upload Image
          </label>
          <button className="bg-gradient-to-r from-purple-600 to-pink-500 text-white py-2 px-4 rounded-md">
            Generate
          </button>
        </div>
      </div>

      {/* Features Section */}
      <div className="flex flex-wrap justify-center mt-12 gap-4">
        <button className="bg-gray-800 text-gray-300 py-2 px-6 rounded-lg hover:bg-gray-700">
          Product Research
        </button>
        <button className="bg-gray-800 text-gray-300 py-2 px-6 rounded-lg hover:bg-gray-700">
          Photoshoots & Images
        </button>
        <button className="bg-gray-800 text-gray-300 py-2 px-6 rounded-lg hover:bg-gray-700">
          Storefront Optimizations
        </button>
      </div>
    </>
  );
};

export default Homepages;
